;; gorilla-repl.fileformat = 1

;; **
;;; # Ceres Analytics
;; **

;; @@
(ns squealing-dawn
  (:refer-clojure :exclude [find sort])
  (:require [gorilla-plot.core :as plot]
            [ceres-analytics.core :refer [db degrees news-accounts time-interval]]
            [gg4clj.core :as gg4clj]
            [monger.collection :as mc]
            [monger.operators :refer :all]
            [monger.query :refer :all]
            [clj-time.core :as t]
            [clj-time.periodic :as p]
            [incanter.stats :refer [mean variance quantile sd]]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def start-date (t/date-time 2014 8 1))
(def end-date (t/date-time 2014 9 1))
(def days-running (t/in-days (t/interval start-date end-date)))
(def dates (take days-running (p/periodic-seq start-date (t/days 1))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;squealing-dawn/dates</span>","value":"#'squealing-dawn/dates"}
;; <=

;; @@
(def source-uids (map :_id (mc/find-maps @db "users" {:screen_name {$in news-accounts}})))
(def source-publications (mc/find-maps @db "publications" {:user {$in source-uids}
                                                           :ts time-interval}))
(def user-publications (mc/find-maps @db "publications" {:user {$nin source-uids}}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;squealing-dawn/user-publications</span>","value":"#'squealing-dawn/user-publications"}
;; <=

;; @@
(let [user-type-freq (->> (mc/find-maps @db "publications")
                          (map :type)
                          frequencies)
      source-type-freq (->> source-publications
                          (map :type)
                          frequencies)
      dat {:types (into (vec (keys user-type-freq)) (keys source-type-freq))
           :counts (into (vec (vals user-type-freq)) (vals source-type-freq))
           :source (into (vec (take 5 (repeat "user"))) (take 4 (repeat "news")))}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes {:x :types :y :counts :fill :source}]]
       [:geom_bar {:stat "identity"}]
       [:xlab "Tweet types"]
       [:ylab "Counts"]
       [:ggtitle "Tweet type distribution"])]
    {:width 10
     :height 6}))
